import './App.css';

function App() {
  const[valuee,setValuee] = useState("")
  const handlesubmit=(e)=>{
     setValuee(e.target.value)
  }
  return (
    <div className="App">
      <div className='container'> 
      <input placeholder='enter password' type= "text" value={valuee} />
      <button 
      onSubmit={()=>handlesubmit(e)}
      >submit</button>
      </div>
       <span className='output'>Output :{valuee} </span>
    </div>
  );
}

export default App;
